window.bookSummaryJSON = "<p>Instinct and violent visions compel Nameless to embark on an unplanned mission to help a desperate mother and daughter on the run. Why is this rescue so strangely familiar to a man with no memories?</p> <p>Evie and her daughter, Asteria, are fleeing an abusive cult when they meet a stranger in an abandoned Arizona shopping mall. Fate hasn’t set Nameless on their trail. It’s a premonition, and a chance to make reparations for a failure from his past he can’t even remember. This time, Nameless must do everything in his power not to fail those who trust him with their lives.</p> <p><i>From #1 </i>New York Times<i> bestselling author Dean Koontz comes </i>Light Has Weight, but Darkness Does Not<i>, part 4 of Season 2 of </i>Nameless<i>, a gripping collection of stories about a man in search of the truth, the past, and those who owe a debt of blood. Follow him through each story, which can be read or listened to in a single sitting.</i></p>"; 
